/* Differences */Misuse of 'English' to mean the UK so should actually be 'British' due to England/English ending in 1707 due to the Acts of Union passed in 1706 and 1707. 
The use of 'English' and 'French' relates to the Nation's and not the language (which of course would be English).
The second part refers to 'English' Canada but is actually denoting the difference between the language of English and French to reference British Canada and French Canada vis-a-vis the 'home' countries/coloni...
